package gdqy.edu.cn.modle;

public class Role {
private int role_id;
private String name;
private int p_value;
public Role() {
	super();
	// TODO Auto-generated constructor stub
}
public int getRole_id() {
	return role_id;
}
public void setRole_id(int roleId) {
	role_id = roleId;
}
public String getName() {
	return name;
}
public void setName(String name) {
	this.name = name;
}
public int getP_value() {
	return p_value;
}
public void setP_value(int pValue) {
	p_value = pValue;
}

}
